679c8c32d3510a8b0c6e6893f6c17300d7acf7ea.source:
query Job {
  job(id: 1) {
    __typename
    id
    name
    startedAt
    finishedAt
    state
    logs
    issuer {
      __typename
      id
      name
    }
    changes {
      __typename
      id
      message
      changer {
        __typename
        id
        name
      }
    }
    stages {
      __typename
      id
      order
      name
      state
      startedAt
      finishedAt
    }
  }
}

